import React from 'react'
import { NavLink } from 'react-router-dom';
import './navbar.css'

const NavBar = (props) => {
  return (
    <div className="navbar">
      <NavLink to="/">Home</NavLink>
      <NavLink to="/classes">Classes Index</NavLink>
      <div
        className="klass-dropdown"
        onClick={(event) => handleKlassDropdownClick(props.klasses)}
        >Classes Dropdown
      </div>
      <NavLink to="/progressions/new">New Progression</NavLink>
      <NavLink to="/progressions">All Progressions</NavLink>
    </div>
  )
}

function handleKlassDropdownClick(klasses){
  return (
    <h1>HI!</h1>
  )
}


export default NavBar
